montageDefine("daa4856","vendor/requirejs/tests/nestedDefine/nestedDefine.html",{text:'<!DOCTYPE html><html><head>\n    <title>require.js: Nested Define Test</title>\n    <script src=../../require.js></script>\n    <script src=../doh/runner.js></script>\n    <script src=../doh/_browserRunner.js></script>\n    <script>\n    require({\n            baseUrl: "./"\n        },\n        ["require", "one"],\n        function(require, one) {\n\n            define("two", function () {\n                return {\n                    name: "two"\n                };\n            });\n\n            define("three", {\n                name: "three"\n            });\n\n            setTimeout(function () {\n                require(["four"], function (four) {\n                    doh.register(\n                        "nestedDefine",\n                        [\n                            function nestedDefine(t){\n                                t.is("one", one.name);\n                                t.is("four", four.name);\n                                t.is("two", four.twoName);\n                                t.is("three", four.threeName);\n                            }\n                        ]\n                    );\n                    doh.run();\n                });\n            }, 15);\n        }\n    );\n    </script>\n</head>\n<body>\n    <h1>require.js: Nested Define Test</h1>\n    <p>Make sure a nested, named define call works in IE.</p>\n    <p>Check console for messages</p>\n\n\n</body></html>'});